    def __init__(self, input=None):
        super(JavaLexer, self).__init__(input)
        self.checkVersion("4.4")
        self._interp = LexerATNSimulator(self, self.atn, self.decisionsToDFA, PredictionContextCache())
        self._actions = None
        self._predicates = None

    def isJavaIdentifierStart(self, codePoint):
        if 'L' in unicodedata.category(chr(codePoint)) or chr(codePoint) == u'$' or chr(codePoint) == u'_':
            return True
        return False

    def isJavaIdentifierPart(self, codePoint):
        if 'L' in unicodedata.category(chr(codePoint)) or 'N' in unicodedata.category(chr(codePoint)) or chr(
                codePoint) == u'$' or chr(codePoint) == u'_':
            return True
        return False

    def toCodePoint(self, high, low):
        return int(high) * 256 + int(low)

    def sempred(self, localctx, ruleIndex, predIndex):
        if self._predicates is None:
            preds = dict()
            preds[142] = self.JavaLetter_sempred
            preds[143] = self.JavaLetterOrDigit_sempred
            self._predicates = preds
        pred = self._predicates.get(ruleIndex, None)
        if pred is not None:
            return pred(localctx, predIndex)
        else:
            raise Exception("No registered predicate for:" + str(ruleIndex))

    def JavaLetterOrDigit_sempred(self, localctx, predIndex):
        if predIndex == 2:
            return self.isJavaIdentifierPart(self._input.LA(-1))

        if predIndex == 3:
            return self.isJavaIdentifierPart(self.toCodePoint(self._input.LA(-2), self._input.LA(-1)))

    def JavaLetter_sempred(self, localctx, predIndex):
        if predIndex == 0:
            return self.isJavaIdentifierStart(self._input.LA(-1))

        if predIndex == 1:
            return self.isJavaIdentifierStart(self.toCodePoint(self._input.LA(-2), self._input.LA(-1)))
